pub fn execute(
    _deps: DepsMut,
    _env: Env,
    _info: MessageInfo,
    msg: ExecuteMsg,
) -> Result<Response, ContractError> {
    match msg {
        // ExecuteMsg::Verify {} => execute::verify(),
        // ExecuteMsg::VerifyCwCrypto {} => execute::verify_cw_crypto(),
        ExecuteMsg::Pairing {} => execute::pairing(),
    }
}

